class Music extends Component {

  render() {
    return (
      <div>
      <h1 className="homeName">Alfy Hushairi</h1>
      <p className ="homeTitle">INTEGRATION ENGINEER.MUSICIAN.INTERACTION DESIGNER</p>
      </div>
    );
  }

}

export default Music;
